import {
    ARTICLE_DATA_LOADED
} from "./feedActions";

const initialState = {
    currentName: null, // 没删除
    studentNames: [], //
};

export const feedReducer = (state = initialState, action) => {
    switch (action.type) {
        case INITIALDATA_LOADED:
            return { ...state, bookStore: action.bookStore };        
        default:
            return state;
    }
};
